import React, { Component } from "react";
import { connect } from "react-redux";

export default class Player extends Component {
  render() {
    console.log("prop", this.props.mangDatCuoc);
    return (
      <div className="text-center playerGame">
        <div className="think">
          <img
            className="mt-3"
            style={{ width: 100, height: 100 }}
            src="./img/gameoantuxi/bua.png"
            alt="./img/gameoantuxi/bua.png"
          />
        </div>

        <div className="speech-bubble"></div>
        <img
          style={{ width: 150, height: 150 }}
          src="./img/gameoantuxi/player.png"
          alt="./img/gameoantuxi/player.png"
        />

        <div className="row">
          <div className="col-4">
            <button className="btnItem">
              <img
                style={{ width: 35, height: 35 }}
                src="./img/gameoantuxi/bao.png"
                alt="./img/gameoantuxi/bao.png"
              />
            </button>
          </div>

          <div className="col-4">
            <button className="btnItem">
              <img
                style={{ width: 35, height: 35 }}
                src="./img/gameoantuxi/bua.png"
                alt="./img/gameoantuxi/bua.png"
              />
            </button>
          </div>

          <div className="col-4">
            <button className="btnItem">
              <img
                style={{ width: 35, height: 35 }}
                src="./img/gameoantuxi/keo.png"
                alt="./img/gameoantuxi/keo.png"
              />
            </button>
          </div>
        </div>
      </div>
    );
  }

}
const mapStateToProps = (state) => {
  return {
    mangDatCuoc: state.oanTuXiReducer.mangDatCuoc,
  };
};
